import React, { useState } from 'react';
import { TextField, MenuItem, FormControl, InputLabel, Select, Box, Button, Card, CardContent, CardMedia, Typography, Dialog, DialogTitle } from '@mui/material';
import { styled } from '@mui/system';

const inputBgColor = process.env.REACT_APP_INPUT_BG_COLOR || 'white';

const StyledTextField = styled(TextField)({
  backgroundColor: inputBgColor,
});

const sampleItems = [
  {
    service: 'Water installation',
    image: 'https://via.placeholder.com/150',
    description: 'Installation of water systems.',
    brand: 'Brand A',
    price: '$100',
  },
  {
    service: 'water quality test',
    image: 'https://via.placeholder.com/150',
    description: 'Testing the quality of water.',
    brand: 'Brand B',
    price: '$50',
  },
  {
    service: 'Water filter',
    image: 'https://via.placeholder.com/150',
    description: 'Water filtration system.',
    brand: 'Brand C',
    price: '$150',
  },
  {
    service: 'Water catridges',
    image: 'https://via.placeholder.com/150',
    description: 'Replacement water cartridges.',
    brand: 'Brand D',
    price: '$30',
  },
];

const AppointmentForm = () => {
  const [date, setDate] = useState('');
  const [service, setService] = useState('');
  const [searchTerm, setSearchTerm] = useState('');
  const [open, setOpen] = useState(false);

  const handleDateChange = (event) => {
    setDate(event.target.value);
  };

  const handleServiceChange = (event) => {
    setService(event.target.value);
  };

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleBookAppointment = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const filteredItems = sampleItems.filter(
    (item) =>
      item.service === service &&
      item.description.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Box component="form" sx={{ display: 'flex', gap: 2, margin: '0 auto', mt: 4, justifyContent: centre }}>
      <StyledTextField
        label="Appointment Date"
        type="date"
        value={date}
        onChange={handleDateChange}
        InputLabelProps={{
          shrink: true,
        }}
        fullWidth
        sx={{width: 300}}
      />
      <FormControl fullWidth>
        <InputLabel>Service</InputLabel>
        <Select
          value={service}
          onChange={handleServiceChange}
          label="Service"
          sx={{width: 300}}
        >
          <MenuItem value="Water installation">Water installation</MenuItem>
          <MenuItem value="water quality test">Water quality test</MenuItem>
          <MenuItem value="Water filter">Water filter</MenuItem>
          <MenuItem value="Water catridges">Water cartridges</MenuItem>
        </Select>
      </FormControl>
      {service && (
        <StyledTextField
          label="Search"
          type="text"
          value={searchTerm}
          onChange={handleSearchChange}
          fullWidth
        />
      )}
      <Box>
        {filteredItems.map((item, index) => (
          <Card key={index} sx={{ display: 'flex', mb: 2 }}>
            <CardMedia
              component="img"
              sx={{ width: 150 }}
              image={item.image}
              alt={item.description}
            />
            <Box sx={{ display: 'flex', flexDirection: 'column' }}>
              <CardContent sx={{ flex: '1 0 auto' }}>
                <Typography component="div" variant="h5">
                  {item.brand}
                </Typography>
                <Typography variant="subtitle1" color="text.secondary" component="div">
                  {item.description}
                </Typography>
                <Typography variant="subtitle1" color="text.secondary" component="div">
                  {item.price}
                </Typography>
                <Button variant="contained" onClick={handleBookAppointment}>
                  Book Appointment
                </Button>
              </CardContent>
            </Box>
          </Card>
        ))}
      </Box>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Your appointment has been booked successfully!</DialogTitle>
      </Dialog>
    </Box>
  );
};

export default AppointmentForm;
